import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Products from './Products';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<h1>Welcome to Home!</h1>} />
        <Route path="/products" element={<Products />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
